import React, {Component} from 'react';
export default class News extends Component {
    render(){
        return (
            <div className='border-bottom border-top padding-sm relative'>
                <div class="ticker-wrap">
                    <div class="ticker">
                        <div class="ticker__item">&nbsp;Invited Talk at GyeongGi Cultural Foundation in Korea.</div>
                        <div class="ticker__item">&nbsp;Invited Talk and Workshop at San Jose State University</div>
                        <div class="ticker__item">&nbsp;Juror for PacificVis 2022</div>
                    </div>
                </div>
            </div>
        )
    }
}
